import React from "react";
import "./App.css";
import "bulma/css/bulma.css";
import Test from "./components/Test";

const App: React.FC = () => {
  return (
    <div className="App">
      <header className="App-header">
        <Test />
      </header>
    </div>
  );
};

export default App;
